import React from 'react'
import { render } from "react-dom";
import axios from "axios";
const elements = [];


function getStarUsers() {
  // Simple GET request using axios
  axios.get('https://swapi.dev/api/people/')
      .then(response => 
        {for (const x of response.data.results){
          console.log(x)

        }
        }
        );
}


  const App = () =>
    elements.map(starUser => {
        let Tag = starUser.tag;
        let attributes = starUser.attributes;
        let value = starUser.value;
        return (
        <Tag class="card" key={starUser.toString()} {...attributes}>
            {value}
        </Tag>
        );
    });

getStarUsers()

ReactDOM.render(<App />, document.getElementById("root"));

export default App;
